import React from 'react'
import './Error404.css'
import { error404_icon } from '../../images/error404.png'

export default function Error404() {
    return (
    <div className='error'>
        <img src={error404_icon} alt="" />
        <h5>weather not found</h5>
    </div>
    )
}
